import React from "react";
import Select from 'react-select';

const NewRow = () => {

    const Countries = [
        { label: "ME Torge (Avg.)", value: 355 },
        { label: "ME Speed (Avg.)", value: 54 },
        { label: "Rate of Return (Avg.)", value: 43 }
      ];

    return(
        <div>
            <div>X</div>
            <input type="text"></input>
            <Select options={Countries} 
              isMulti />
        </div>
    )
    ;
}

export default NewRow;
